import React from "react";


class ArticlePage extends React.Component  {

  state = {
    article_id : null,

  }

  componentDidMount(){
    this.setState({
      article_id : this.props.match.params.article_id
    })
  }

  render(){
    const {
      article_id
    } = this.state

    return (

      <React.Fragment>
        <h1>Blog page </h1>



        <h1>{article_id}</h1>

      </React.Fragment>
    );
  }
}

export default ArticlePage;
